export class Repair_article2 extends Component {
    render() {
        return (
            <div>
                <div className="article-wrapper">
                    <div className="container">
                        <div className="row">
                            <div className="col-12">
                                <div className="row">
                                <a class="btn btn-primary" href="/repair" role="button">Return to articles</a>
                                </div>
                                <img src={"https://www.zr.ru/_ah/img/6uapcnxVV6Qp-sCVv2D-IQ=s800"} alt="" style={{ height: "15rem", width: "20rem"}} />
                                <h2>How to master jackscrew</h2>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
